from flask import Flask, jsonify

app = Flask(__name__)

@app.route('/')
def home():
    return jsonify({"message": "Hello from Python on Vercel!"})

@app.route('/api/hello')
def hello():
    return jsonify({"message": "Greetings from the Python API!"})

if __name__ == '__main__':
    app.run(debug=True)
